import React from "react";
import { useSelector, shallowEqual, connect } from "react-redux";

const Profile = ({ lastUpdate, light, form }) => {
  return (
    <div>
      <h1>Profile</h1>
      <h1>{lastUpdate}</h1>
      <h1>{form.toString()}</h1>
    </div>
  );
};

function mapStateToProps(state) {
  const { lastUpdate, light, form } = state;
  return { lastUpdate, light, form };
}

export default connect(mapStateToProps)(Profile);
